  "detection": [
    {
      "id": "DS0009",
      "name": "Process",
      "components": [
        {
          "name": "OS API Execution",
          "description": "Monitoring Windows API calls indicative of the various types of code injection may generate a significant amount of data and may not be directly useful for defense unless collected under specific circumstances for known bad sequences of calls, since benign use of API functions may be common and difficult to distinguish from malicious behavior. Windows API calls such as CreateRemoteThread, SuspendThread/SetThreadContext/ResumeThread, and those that can be used to modify memory within another process, such as VirtualAllocEx/WriteProcessMemory, may be used for this technique."
        },
        {
          "name": "Process Access",
          "description": "Monitor for processes being viewed that may inject malicious code into suspended and hollowed processes in order to evade process-based defenses."
        },
        {
          "name": "Process Creation",
          "description": "Monitor for newly executed processes that may inject malicious code into suspended and hollowed processes in order to evade process-based defenses. Adversaries may start legitimate processes and then use their memory space to run malicious code. This analytic looks for common Windows processes that have been abused this way in the past; when the processes are started for this purpose they may not have the standard parent that we would expect. This list is not exhaustive, and it is possible for cyber actors to avoid this discepency. These signatures only work if Sysmon reports the parent process, which may not always be the case if the parent dies before sysmon processes the event."
        },
        {
          "name": "Process Modification",
          "description": "Monitor for changes made to processes that may inject malicious code into suspended and hollowed processes in order to evade process-based defenses."
        }
      ]
    }
